import React from 'react'

function Articles(props) {
  return (
    <div>
      <h1>Info de l'API</h1>
      {props.articles.map((article) => {
        return (
          <div key={article.id}>
            <h2>{article.title}</h2>
            <p>{article.content}</p>
            <p>{article.category}</p>
          </div>
        );
      })}
    </div>
  );
}

export default Articles;
